export interface Company {
    cod_empresa?,
    nombre_empresa?:string,
    rif?,
    base_de_datos?,
    tipo_factura?
}

export class CompanyImpl implements Company {
    public logo : string = null;
    public logo_width : number = 0;
    public logo_height : number = 0;
    constructor(
        public cod_empresa?,
        public nombre_empresa?,
        public rif?,
        public base_de_datos?,
        public tipo_factura?
    ){
        if(this.nombre_empresa.match('SERVICIOS ACERO GLOBAL 26, C.A')) {
            this.logo = 'data:image/jpeg;base64,';
            this.logo_width = 25;
            this.logo_height = 22;
        } 
        if(this.nombre_empresa.match('DISTRIBUIDORA ACERO MAX A 36, C.A.')) {
            this.logo = 'data:image/jpeg;base64,';
            this.logo_width = 35;
            this.logo_height = 10;
        } 
        if(this.nombre_empresa.match('COOP. REV. DE TRANSPORTE PP RL') ||
        this.nombre_empresa.match('COOP. REV. DE TRANSP. PUEBLO RL')) {
            this.logo = 'data:image/jpeg;base64,';
            this.logo_width = 30;
            this.logo_height = 15;
        } 
        if(this.nombre_empresa.match('A.C DE TRANSPORTE SOCIALISTA GUAYANA R.L') ||
        this.nombre_empresa.match('COOPERATIVA GUAYANA')) {
            this.logo = 'data:image/jpeg;base64,';
            this.logo_width = 25;
            this.logo_height = 21;
        } 
        if(this.nombre_empresa.match('ADMINISTRADORA 2050')) {
            this.logo = 'data:image/jpeg;base64,';
            this.logo_width = 35;
            this.logo_height = 15;
        }
    }
}
